import React from 'react';
import Nav from '../Nav';
import './home.css';
import imageSrc from '../../images/04.jpg';
import image0 from '../../images/05.jpg';

function Home() {
  return (
    <div>
      <div className='nav03'>
        <Nav />
      </div>

      <div className='container03'>
        <img src={image04} alt='image'/>
        <img src={image05} alt='image'/>
      </div>
    </div>
  );
}

export default Home;
